import React, { useState } from 'react'
import Modal from 'react-modal';

import "./Domains.scss"

Modal.setAppElement()

const Domains = ({img, alt, title}) => {
    const [modalIsOpen, setIsModalOpen] = useState(false)
    return (
        <div class="main-item">
            <img class="img" src={img} alt={alt} />
            <h1>{title}</h1>
        </div>
    )
}

export default Domains
